description:
L’objectif du projet est de renforcer la contribution effective des organisations de la société civile à la consolidation de l’Etat de droit, à la démocratisation et au développement socio-économique du Maroc.
Trois composantes sont prévues :

Composante 1 - Un accompagnement institutionnel/incubation/coaching dans les 5 régions ciblées avec un acteur de la société civile qui a recours à des méthodes innovantes et alternatives en matière d'appui ;
Composante 2 - Le renforcement de la participation citoyenne dans les processus des politiques publiques locale, régionales et nationales ( à déléguer à Enabel) ;
Composante 3 - Assistance technique pour la  communication visibilité et capitalisation
